easurement for diamonds, is approximately 0.2 grams. You may also hear the weight of a diamond referred to in points. One carat is equivalent to 100 points, so a 75-point diamond is equal to 0.75 carats. Because they are rarer, larger diamonds have greater value per carat, so the value of a diamond rises exponentially to its size. Diamond Cut Diamond cut refers to the proportions, finish, symmetry and polish of the diamonds. These factors determine the intensity and brilliance of a diamond. A well-cut diamond is proportioned, symmetrical, and polished; these are typically the most expensive types of diamond. The width and depth of the cut can have an effect on how light travels within the diamond and how it exits in the form of brilliance.	99.99	{a5438739-fddf-4adc-83cf-f59a10a41670}	{9,12}	\N	4ecef245-d048-4727-a9b0-4cb9a12d0e42	\N	\N	\N	2025-03-02 16:47:09.96307+02	2025-03-02 16:47:09.96307+02
