rs are commonly located under sinks, in small apartments, and in additions like side rooms and garages. What type of point-of-use electric water heater should I buy? Mini-tank water heaters preheat a small amount of reserved water until it's ready to be used. Tankless water heaters heat water on demand as it travels through electrical heating elements within the unit. What will happen if I connected this water heater to my hot water line? The cold water in the line will flow into the tank first and mix with the hot water there. The mini tank water heater will turn on heating until the hot water from your main water heater eventually reaches the mini tank Can this mini tank water heater be used for shower? A mini-tank water heater is not intended to service a shower because it requires a larger flow from 1.5gpm to 2.5gpm, while these mini tank capacity range from 1.3 gallons, 2.5 gallons and 4 gallons, to max 6.5 gallons.	229.99	{784e5004-a9bf-4a1b-bbef-acc3f00e215a}	{11}	\N	4ecef245-d048-4727-a9b0-4cb9a12d0e42	\N	\N	\N	2025-03-02 16:47:30.2054+02	2025-03-02 16:47:30.2054+02
